Creating jsonwebtoken to authentication<p>I have a problem with back end part in my app and I hope you will help me. I'm new in in back-end.
I made Express server in server.js and connected MongoDB. After that I required jwt and add createAccessToken and createRefreshToken in userCtrl.js and I checked in postman if it become requests. With access token with POST request I have not problem, but when I began to add refresh token, in the postman it hasn't authorization. Can I become some help. I don't know where is wrong.</p>
<p>I put my code :</p>
<p><strong>userRouter.js</strong></p>
<pre><code>const router = require('express').Router()
const userCtrl = require('../controlleers/userCtrl')

router.post('/register', userCtrl.register)

router.get('/refresh_token', userCtrl.refreshToken)

module.exports = router
</code></pre>
<p><strong>.env</strong></p>
<pre><code>MONGO_URL = ************
ACCESS_TOKEN_SECRET = ***********
REFRESH_TOKEN_SECRET = **********
</code></pre>
<p><strong>userModel.js</strong></p>
<pre><code>const mongoose = require('mongoose')
const userSchema = new mongoose.Schema(
  {
    name: {
      type: String,
      required: true,
      trim: true,
    },

    email: {
      type: String,
      required: true,
      unique: true,
    },

    password: {
      type: String,
      required: true,
    },
    role: {
      type: Number,
      default: 0,
    },

    cart: {
      type: Array,
      default: [],
    },
  },

  {
    timestamps: true,
  }
)

module.exports = mongoose.model('Users', userSchema)

</code></pre>
<p><strong>userCtrl.js</strong></p>
<pre><code>const Users = require('../models/userModel')

const bcrypt = require('bcrypt')

const jwt = require('jsonwebtoken')

const userCtrl = {
  register: async (req, res) =&gt; {
    // async before a function means one simple thing: a function always returns a promise.

    try {
      const { name, email, password } = req.body

      const user = await Users.findOne({ email }) // wait until the promise resolves

      if (user) return res.status(400).json({ msg: 'The email already exists' })

      if (password.length &lt; 6) return res.status(400).json({ msg: 'Password is at least 6 characteres long.' })

      //Password encryption

      const passwordHash = await bcrypt.hash(password, 10)

      const newUser = new Users({
        name,
        email,
        password: passwordHash,
      })

      // save mongodb

      await newUser.save()

      //then create jsonwebtoken to authentication

      const accesstoken = createAccessToken({ id: newUser._id })

      const refreshtoken = createRefreshToken({ id: newUser._id })

      res.cookie('refreshtoken', refreshtoken, {
        httpOnly: true,

        path: '/user/refresh_token',
      })

      res.json({ accesstoken })

      //res.json({msg: &quot;Register Success!&quot;})
    } catch (err) {
      return res.status(500).json({ msg: err.message })
    }
  },
  refreshToken: (req, res) =&gt; {
    const rf_token = req.cookies.refreshtoken

    res.json({ rf_token })
  },
}
const createAccessToken = (user) =&gt; {
  return jwt.sign(user, process.env.ACCESS_TOKEN_SECRET, { expiresIn: '1d' })
}

const createRefreshToken = (user) =&gt; {
  return jwt.sign(user, process.env.REFRESH_TOKEN_SECRET, { expiresIn: '7d' })
}

module.exports = userCtrl
</code></pre>
<p><strong>server.js</strong></p>
<pre><code>require('dotenv').config()
const express = require('express')
const mongoose = require('mongoose')
const cors = require('cors')
const fileUpload = require('express-fileupload')
const cookieParser = require('cookie-parser')

const app = express()
app.use(express.json())
app.use(cookieParser())
app.use(cors())

// Use temp files instead of memory for managing the upload process.
app.use(fileUpload({
    useTempFiles: true
}))

// Routes
app.use('/user', require('./routes/userRouter'))

// Connect to Mongodb
const URL = process.env.MONGO_URL
mongoose.connect(URL,{
    useCreateIndex: true,
    useFindAndModify: false,
    useNewUrlParser: true,
    useUnifiedTopology: true
}, err =&gt;{
    if(err) throw err;
    console.log('Connected to MongoDB')
})



const PORT = process.env.PORT || 5000
app.listen(PORT, () =&gt; {
    console.log('Server is running on port', PORT)
})
</code></pre>

