MongoDB aggregation $lookup to parent array field with pipeline syntax and _id as string<p>I have the following collections in my MongoDB (v.4.4):</p>
<p><code>guilds</code>:</p>
<pre class="lang-js prettyprint-override"><code>{
 _id: String,
 members: [{ _id String, rank: number },{ _id String, rank: number }...]
}
</code></pre>
<p>and <code>characters</code>:</p>
<pre class="lang-js prettyprint-override"><code>{
  _id: String,
  many_other: 'fields'
}
</code></pre>
<p>And I'd like to join with the <code>$lookup</code> pipeline syntax <code>guild.members &lt;= characters</code> by <code>_id</code> field.</p>
<blockquote>
<p><em>I don't use Mongo build-in <code>OjbectIds</code> as <code>_id</code>, I overwrite it with strings in both collections. As I heard, there is a bit different behaviour with <code>$lookup</code> with strings as <code>_id</code> in pipelines. So make sure, that you knew about it, before answering.</em></p>
</blockquote>
<p>The expected result that I want is simple, I'd like to save rank from the original document, and also add any other field from <code>$lookup</code> it:</p>
<pre class="lang-js prettyprint-override"><code>{
  _id: String // (guild)
  members: [
    {
      _id: String, // (characters)
      rank: number,
      many_other: '...fields from characters'
    },
    {
      _id: String, // (characters)
      rank: number,
      many_other: '...fields from characters'
    }, ...
]
</code></pre>
<p><a href="https://mongoplayground.net/p/8hbrNVWe9TA" rel="nofollow noreferrer">Mongo Playground example: <strong>avaliable</strong></a></p>
<p>What have I tried:</p>
<p>Various queries, like:</p>
<pre class="lang-js prettyprint-override"><code>      {
        $lookup: {
          from: &quot;characters&quot;,
          pipeline: [
            {
              $match: {
                $expr: { $eq: [ { $toString :&quot;$members._id&quot; }, { $toString : &quot;$$character_id&quot; } ] }
              }
            }
          ],
          as: &quot;guild_members&quot;
        },
      }
</code></pre>
<p>With converting ID's to string, with <code>let</code> stages variables, and using <code>$map</code> operator. But I still far away from the required result.</p>
<blockquote>
<p><em>There is also another problem, which is some relevance to the question, but not related to queries itself</em></p>
</blockquote>
<p>As you may see, the <code>characters</code> collection has <code>many other fields</code>. Some of them are pretty heavy, (because guilds can have up to 500 members) which making the result document  &gt;16 MB (MongoDB threshold limit) which gives an error. Since, as far as I know, we could not pick fields from <code>joined</code> documents, it will be much better to exclude it right after the <code>$lookup</code> stage or something like that. Any advice about it will be pretty welcome.</p>

