<p>I am trying to set the key as the <code>fieldName</code> from the <code>headers</code> matching that using the <code>_id</code> parameter with the respective <code>field_id</code> from <code>customData</code> in the <code>list</code> array. I also want to exclude any items in <code>customData</code> where <code>systemDelete_DT</code> is not <code>null</code>.</p>
<p>I've tried using <code>$map</code> and <code>$filter</code> but not got any where!</p>
<p>How do i re-map the array like my example below?</p>
<p><a href="https://mongoplayground.net/p/8_2BIQJo7Y1" rel="nofollow noreferrer">Playground Attempt</a></p>
<p><strong>My attempt :(</strong></p>
