How to check if two URL's lead to the same path?<p>I'm building a URL Shortener, and I've decided to recyle the short ID's if possible to save space in my database. How can i check if 2 URL's lead to the same path?</p>
<p>For example, let's say a user generates a short URL for <code>https://google.com/</code>.</p>
<p>My app generates the following short id: <code>jkU3</code></p>
<p>So if this user visits <code>https://tiny.url/jkU3</code> my express server will redirect the visitor to <code>https://google.com/</code>.</p>
<p>This works like a charm, but know let's imagine another person visits <code>https://tiny.url/</code> and generates a short URL for <code>https://google.com</code>. And another one comes and generates a short URL for <code>https://www.google.com/</code>, and another one comes and generates one for <code>https://www.google.com</code>. You get the point..</p>
<p>So far my app would have wasted 4 short ID's.</p>
<p>How can i prevent this from happening? Is there a regex for this?</p>
<p>This is the current code I have for generating short URL's:</p>
<pre><code>app.post(&quot;/&quot;, (req: Request, res: Response) =&gt; {
  const shortUrl: string = nanoid(4);
  const destination: string = req.body.destination;

  UrlSchema.create({
    _id: mongoose.Types.ObjectId(),
    origin: shortUrl,
    destination: destination,
  }).then(() =&gt; {
    // Unique Id
    res.json(shortUrl);
  });
});
</code></pre>

