Is there any way to callback after document remove from collection by TTL?<p>My problem is &quot;When users order an order, the email will be sent to user's email, with a link to confirm the order in the content. At this time, the amount of the products in the order will be reduced. After 24h, if user doesn't confirm by email link, the order will be delete and the amount of products will be back to database.&quot;</p>
<p>So I need a callback function to set the amount of products back? Is there another way to set expire?</p>
<p>Here is my Model order.js code:</p>
<pre><code>const OrderSchema = new Schema({
    ...
    paid: {           
        type: Boolean,
        default: false
    },
    payment_method: {
        type: String,
        enum: ['local', 'paypal'],
        default: 'local'
    },
    status: {          
        type: Number,
        default: 0
    },
    confirmed: {        // After order, users must confirm order by email link
        type: Boolean,
        default: false,
        index: true
    }
}, {
    timestamps: true
})

const Order = mongoose.model('Order', OrderSchema)

// After 24h, if user doesn't confirm by email link, the order will be delete
 OrderSchema.index({
    createdAt: 1
},{
    expireAfterSeconds: 24*60*60,
    partialFilterExpression : {
        confirmed: false
    }
});
</code></pre>
<p>Thanks in advance.</p>

